import cx from 'classnames'
import styles from './modal.module.scss'

interface Props {
  contents: string
  isShow: boolean
}

const Modal = ({ contents, isShow }: Props) => {
  return (
    <div className={cx(styles.modal, { [styles.isShow]: isShow })}>
      <p>{contents}</p>
      <div>
        <button type='button'>취소</button>
        <button type='button'>확인</button>
      </div>
    </div>
  )
}

export default Modal
